if mibBuilder.loadTexts: rc2kCardFrontType.setDescription("Used to indicate card types in the Accelar 8000 product families. For Accelar 8000 devices, all cards use an encoded value according to the following rule: | 6 | 1 | 5 | 4 | 1 | 3 | 4 | 8 | +------+-------+-------+-------+------------+------+------+------+ bits : |31-26 | 25 | 24-20 | 19-16 | 15 | 14-12 | 11-8 | 7-0 | +------+-------+-------+-------+----+-------+------+------+------+ field : | a | b | c | d | e | f | g | h | +------+-------+-------+-------+----+-------+------+------+------+ a : Family type/Product line (6 bits (5 bits usuable) (was 4 bits)) MSB bit31 should not be used (MIB compiler fails) 0x0-00 = 0000-00 = Reserved 0x1-00 = 0001-00 = Monoploy non specific (e.g backplane, psu, fans) 0x2-00 = 0010-00 = Boardwalk 0x2-01 = 0010-01 = Power Ranger 0x3-00 = 0011-00 = Marvin Gardens 0x4-00 = 0100-00 = Thunderbolt (was Pacific) 0x5-00 = 0101-00 = PP8300 (was ParkPlace) 0x6-00 = 0110-00 = Central Office (only used in chassis) 0x7-00 = 0111-00 = Alteon WebSystems b : Interface / Device type variation: 1 bit (was 3 bits, 2 bits were stolen by faimly) MSB bit31 should not be used (MIB compiler fails) 0x0-00 = 0000-00 = Reserved 0x1-00 = 0001-00 = Monoploy non specific (e.g backplane, psu, fans) 0x2-00 = 0010-00 = Boardwalk 0x2-01 = 0010-01 = Power Ranger 0x3-00 = 0011-00 = Marvin Gardens 0x4-00 = 0100-00 = Thunderbolt (was Pacific) 0x5-00 = 0101-00 = PP8300 (was ParkPlace) 0x6-00 = 0110-00 = Central Office (only used in chassis) 0x7-00 = 0111-00 = Alteon WebSystems b : Interface / Device type variation: (Were 3 bits, 2 bits taken by family) 0x1 = 1 = M-module (128K RARU records) c : Interface / device type: (5 bits) 0x0 = 00000 = CPU 0x1 = 00001 = Switch fabric 0x2 = 00010 = Copper Ethernet 0x3 = 00011 = Fiber Ethernet 0x4 = 00100 = Sonet (Packets) 0x5 = 00101 = ATM 0x6 = 00110 = Token Ring 0x7 = 00111 = RMON 0x8 = 01000 = BFM (Frame or cells indicated by field 'a' above) 0x9 = 01001 = PSU 0xa = 01010 = Fan Tray 0xb = 01011 = Chassis/Backplane 0xc = 01100 = CPU Mezz 0xd = 01101 = SSL 0xe = 01110 = LaunchPad 0xf = 01111 = reserved for future 0x10 = 10000 = reserved for future 0x11 = 10001 = reserved for future 0x12 = 10010 = reserved for future 0x13 = 10011 = WSM Fiber Ethernet d : Maximum speed (highest negotiable speed) (4 bits) 0x0 = 0000 = 10 Mbit 0x1 = 0001 = 100 Mbit 0x2 = 0010 = 1 Gbit 0x3 = 0011 = 10 Gbit 0x4 = 0100 = OC-3 0x5 = 0101 = OC-12 0x6 = 0110 = OC-48 0x7 = 0111 = OC-92 0x8 = 1000 = OC-192 0x9 = 1001 = 4 Mbit (TR) 0xa = 1010 = 16 Mbit (TR) 0xb = 1011 = E3 0xc = 1100 = DS1 0xd = 1101 = DS3 0xe = 1110 = none (no PHY interfaces on board) 0xf = 1111 = Max speed indicated implicitly in field (c) (for expansion) e : AM&OM-06/28/2006: This bit was originally used to indicate port redundancy. For PR it is used as a differentiator between Boomslang (0) and Copperhead (1). 0=non-redundant, (1 bit) 1=redundant f : Card specific info. (3 bits) For Gigabit used as follows: 000=short-haul (SX) 010=long-haul (LX) 100=extra-distance (DX) 101=GBIC For 10 Gigabit used as follws 000 = 10GE WAN serial 1310nm (XLW) 001 = 10GE WAN serial 1550nm (XEW) 100 = 10GE LAN serial 1310nm (XLR) 101 = 10GE LAN serial 1550nm (XER) 011 = 10GE LAN/WAN (XZW) For ATM/Sonet used as follows 000 = multi mode 001 = single mode 010 = single or multimode 011 = not applicable (e.g., copper has no mode) For Marvin Gardens, indicates number of MDA slots 000 = none 001 = one option slots 010 = two option slots 011 = three option slots For Power Supplies: 000 = AC PSU 001 = DC PSU For CPU Mezz: 000 = MPC755/MPC107 Mezz For SSL: 000 = server offloading 001 = end to end encryption For WSM: 000 = WSM mode 001 = ASFM mode For 8003 (3 slot) chassis differentiation: 000 = ERS 8003 001 = MERS 8003-R (Triumph) 000: PP8300 48TX, 10/100/1000 without POL 001: PP8300 48TX, 10/100/1000 with POL 010: SFP 000: non SFP g : Chassis type (4 bits, possibly MSB 2 bits are extension of field b) 0x0 = 00-00 = work-group (single card switches, etc) 0x1 = 00-01 = back-bone (chassis based products) 0x2 = 00-10 = MDA (option modules) h : Number of ports (binary representation obmited) (8 bits) (for ACIM/BFM cards, this is number of octapids/blackbirds/dea) 0x00 = no ports (cpus, switch fabrics) 0x01 = 1-port, 0x02 = 2-port, 0x04 = 4-port, 0x06 = 6-port, 0x08 = 8-port, 0x0c = 12-port, 0x10 = 16-port, 0x18 = 24-port, 0x22 = 36-port, 0x30 = 48-port, 0x40 = 64-port. ")
